import React from 'react';

class WireFrameDelete extends React.Component {

    render() {
        const { wireFrame } = this.props;
        console.log("WireFrameCard, wireframe.id: " + wireFrame.id);
        return (
            <div className="col s3 z-depth-2 rounded grey lighten-4 todo-list-link hoverable card-content grey-text text-darken-4 item_card">

                    <i className="central-align material-icons">delete</i>

            </div>
        );
    }
}
export default WireFrameDelete;
